import {  GET_PLACE ,
  GOT_PLACE, 
  FAIL_PLACE,  }  from '../Actions/lodgeA';

const initialState = {
 name:[],
 isFetching:false,
 error:null

};

export const lodge = (state = initialState, action) => {
  switch (action.type) {
    case GET_PLACE:
      return {
        ...state,
        isFetching:true,
      }
    case FAIL_PLACE:
      return {
        ...state,
        name:[],
        err:action.payload,

        }
    case GOT_PLACE:
      return {
        ...state,
        name:action.payload,
        isFetching:false,
        // message:'grabbing'
      }
    default: 
    return state;
  } 
}
